重ねるほどにロングでボリューミーな濃密まつ毛になるマスカラです。<br>　<br>ヘビーローテーション ロングボリュームダイナミックマスカラ 01エナメルブラック<br><br>重ねるほどに長く、ボリューミーな濃密まつ毛に仕上がるマスカラ(ブラック)です。汗・水・皮脂・こすれに強く、長時間にじみを防ぎます。フィルムタイプなので、ぬるま湯でスルッと簡単に落せます。何度重ね塗りしてもダマになりにくく、上向きカールが長時間持続。つけまつ毛の上からも使えます。<br> 使用方法：<br>1.最初に上まつ毛の上側から全体に軽くつけます。<br>2.ブラシを上まつ毛の下側の根本にあて、持ち上げるようにつけます。左右に小刻みに揺らしながら塗るとたっぷりつきます。<br>3.下まつ毛や細かい部分はブラシの先端を使うときれいに仕上がります。 <br><br>ご注意：<br>●傷、はれもの、湿疹等、異常のあるときは、ご使用をおやめください。<br>●使用中、又は使用後日光に当たって、赤味、はれ、かゆみ、刺激等の異常があらわれたときは、使用を中止し、皮膚科専門医へご相談をおすすめします。そのまま他の化粧品も含めて使用を続けますと悪化することがあります。<br>●目に入らないようご注意ください。万一、目に入ったときは、こすらず、すぐに水で洗い流してください。<br>●極端に高温又は低温、直射日光のあたるところ、水気のあるところには置かないでください。<br>●使用後は、容器の口元をきれいにふきとり、しっかりキャップを閉めてください。<br>●ブラシへのつきが少なくなった場合は、容器の壁面についている液をブラシで軽くかきまぜてからお使いください。<br>●つけまつ毛に使用した場合は、ご使用後しっかりとマスカラを落とし完全に乾かしてください。清潔にお使いいただくため、マスカラがついたままのつけまつ毛の再使用、半乾き状態でのご使用はおやめください。<br> <br>成分<br>水、アクリル酸アルキルコポリマーアンモニウム、ミツロウ、カルナウバロウ、PG、ステアリン酸、カオリン、TEA、ナイロン-6、パンテノール、センブリエキス、オタネニンジン根エキス、イソステアリン酸PEG-20ソルビタン、セテアリルアルコール、ポリビニルアルコール、トリステアリン酸スクロース、ステアリン酸PEG-15グリセリル、セルロースガム、フェノキシエタノール、アラビアゴム、メチルパラベン、プロピルパラベン、EDTA-2Na、デヒドロ酢酸Na、BG、エタノール、酸化鉄 <br><br>原産国：日本<br><br> お問い合わせ先：株式会社 伊勢半：03-3262-3123  <br>販売_製造元： 伊勢半<br>ブランド：ヘビーローテーション<br>JAN：4901433035453<br>CS：999<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
